import styled from "styled-components";

function Header() {
  return (
    <div>
      <Wrapper>
      <LogoWrapper>
       <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Ftwitter.com%2Fgoogle&psig=AOvVaw1KS7-u18lyiLFKrCt6peEj&ust=1616265665544000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCPCPuPyAve8CFQAAAAAdAAAAABAD"></img>
      </LogoWrapper>
      </Wrapper>
    </div>
  );
}

export default Header;

